    def self.search_dictionaries(args)
    #autocomplete
    if (!!args[:autocomplete_items])
      return items = case args[:autocomplete_items]
        when "arg"
          ARG_DICT.keys
        when "argType"
          TYPE_DICT.keys
        when "argSubtype"
          SUBTYPE_DICT.keys
        when "rank"
          RANK_DICT.keys
        when "sample"
          SAMPLE_DICT.keys
        when "ecoType"
          ECO_TYPE_DICT.keys
        when "ecoSubtype"
          ECO_SUBTYPE_DICT.keys
        else
          []
      end
    end

    #searching
    if args["sample"]
      returned_rows_index = SAMPLE_DICT[args["sample"].to_sym]
    elsif args["ecoType"]
      returned_rows_index = ECO_TYPE_DICT[args["ecoType"].to_sym]
    elsif args["ecoSubtype"]
      returned_rows_index = ECO_SUBTYPE_DICT[args["ecoSubtype"].to_sym]
    else
      returned_rows_index = (0...854).to_a
    end

    if args["arg"]
      returned_cols_index = ARG_DICT[args["arg"].to_sym]
    elsif args["argSubtype"]
      returned_cols_index = SUBTYPE_DICT[args["argSubtype"].to_sym]
    elsif args["argType"]
      returned_cols_index = TYPE_DICT[args["argType"].to_sym]
    elsif args["rank"]
      returned_cols_index = RANK_DICT[args["rank"].to_sym]
    else
      returned_cols_index = (0...4970).to_a
    end

    return {returned_rows_index: returned_rows_index, returned_cols_index: returned_cols_index}
  end

  
  def self.search(queries)
    grid16s = []
    gridCell = []
    gridPpm = []
    xHeaders  = []
    yHeaders = []

    e_value_dictionary = {"1e-6": "1e-06", "1e-7": "1e-07", "1e-8": "1e-08", "1e-9": "1e-09"}
    returned_rows_index = []
    returned_cols = []

    indexes = self.search_dictionaries(queries)
    returned_cols_index = indexes[:returned_cols_index]
    returned_rows_index = indexes[:returned_rows_index]

    abundanceRow = [] 
    if (returned_cols_index && returned_rows_index) 
      #build grid
      CSV.foreach(Rails.root.join("new csv/"+ "#{queries["identity"]}.#{queries["hitLength"]}.#{e_value_dictionary[queries["eValue"].to_sym]}.csv"), headers: false) do |row|
        if $. > 4
          if returned_rows_index.include? ($. - 5)
            xHeaders << [row[0], row[2], row[1]]
            row[3..-1].values_at(*returned_cols_index).each { |abundances|
              #split string
              abundanceRow << abundances.match(/(.*) \/ (.*) \/ (.*)/)[1..3]
            }
            
            abundanceRow = abundanceRow.transpose
            grid16s << abundanceRow[0]
            gridCell << abundanceRow[1]
            gridPpm << abundanceRow[2]
            abundanceRow = []
          end
        else
          yHeaders << row[3..-1].values_at(*returned_cols_index)
        end
      end
      return {items: {}, table: 2, xHeaders: xHeaders, yHeaders: yHeaders.transpose, grid16s: grid16s, gridCell: gridCell, gridPpm: gridPpm}.to_json
    else
      return {items: {}, table: 2, xHeaders: [[]], yHeaders: [[]], grid16s: [[]], gridCell: [[]], gridPpm: [[]]}.to_json
    end
  end
